import './App.css';
import {Link} from "react-router-dom"
import AboutMe from "./components/AboutMe"


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <AboutMe />
        <Link to="/paintings">About Me</Link> {/* Use Link to navigate to Paintings */}
      </header>
    </div>
  );
}

export default App;
